import axios from 'axios';
import { useState } from "react";



function NewDesk(){


  const [id, setId] = useState("");
  const [authorityname, setAuthorityName] = useState("");
  const [password, setPassword] = useState("");
  const [pos, setPos] = useState("");
  const [username, setUserName] = useState("");
  const [instid, setInstId] = useState("");


  async function save(event){
    event.preventDefault();
    try {
        await axios.post("http://192.168.144.185:8080/desk",{
          id:id,
          authority_name:authorityname,
          password:password,
          pos:pos,
          username:username,
          inst_id:instid

    });
    alert("Student registration sccessful")

    } catch (error) {
      alert("Student registration failed")
    }
  }

    return(

    <section class="vh-100" Style="background-color:white;">
        <div class="container h-100">
          <div class="row d-flex justify-content-center align-items-center h-100">
            <div class="col-xl-9">

              <h1 class="text-white mb-4">New Desk</h1>

              <div class="card" Style="border-radius: 15px;">
                <div class="card-body">

                  <div class="row align-items-center pt-4 pb-3">
                    <div class="col-md-3 ps-5">

                      <h5 class="mb-0">Desk Id</h5>

                    </div>
                    <div class="col-md-9 pe-5">

                      <input type="number" size="50px" id="courseid" placeholder="Enter Desk Id" value={id}
                      onChange={(event)=>{
                        setId(event.target.value);
                      }}
                       />

                      <br/> 

                    </div>
                  </div>

                  {/* <div class="px-5 py-4">
                    <button type="submit" class="btn btn-primary btn-lg">Add Student</button>
                  </div> */}

                  <hr class="mx-n3"/>

                  <div class="row align-items-center pt-4 pb-3">
                    <div class="col-md-3 ps-5">

                      <h5 class="mb-0">Authority Name</h5>

                    </div>
                    <div class="col-md-9 pe-5">

                      <input type="text" size="50px" id="authorityname" placeholder="" value={authorityname}
                      onChange={(event)=>{
                        setAuthorityName(event.target.value);
                      }}
                       />

                      <br/>

                    </div>
                  </div>

                  <hr class="mx-n3"/>
                  <div class="row align-items-center pt-4 pb-3">
                    <div class="col-md-3 ps-5">

                      <h5 class="mb-0">Password</h5>

                    </div>
                    <div class="col-md-9 pe-5">

                      <input type="text" size="50px" id="password" placeholder="Enter Password" value={password}
                      onChange={(event)=>{
                        setPassword(event.target.value);
                      }}
                       />

                      <br/>

                    </div>
                  </div>

                  <hr class="mx-n3"/>

                  <div class="row align-items-center pt-4 pb-3">
                    <div class="col-md-3 ps-5">

                      <h5 class="mb-0">Position</h5>

                    </div>
                    <div class="col-md-9 pe-5">

                      <input type="text" size="50px" id="pos" placeholder="Enter Position" value={pos}
                      onChange={(event)=>{
                        setPos(event.target.value);
                      }}
                       />

                      <br/>

                    </div>
                  </div>

                  <hr class="mx-n3"/>

                  <div class="row align-items-center pt-4 pb-3">
                    <div class="col-md-3 ps-5">

                      <h5 class="mb-0">Username</h5>

                    </div>
                    <div class="col-md-9 pe-5">

                      <input type="text" size="50px" id="username" placeholder="Enter Username" value={username}
                      onChange={(event)=>{
                        setUserName(event.target.value);
                      }}
                       />
                       <br/>

                    </div>
                  </div>
                  <hr class="mx-n3"/>
                  <div class="row align-items-center pt-4 pb-3">
                    <div class="col-md-3 ps-5">

                      <h5 class="mb-0">Institute Id</h5>

                    </div>
                    <div class="col-md-9 pe-5">

                      <input type="number" size="50px" id="instid" placeholder="Enter Institute Id" value={instid}
                      onChange={(event)=>{
                        setInstId(event.target.value);
                      }}
                       />
                       <br/>

                    </div>
                  </div>

                  <div class="px-5 py-4">
                    <button type="submit" class="btn btn-primary btn-lg" onClick={save}>Create Desk</button>
                  </div>
                </div>
              </div>

            </div>
          </div>
        </div>
      </section>

    )
}

export default NewDesk;
